cordova.define("com.jiedaibao.regionselect.RegionSelect", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       selectRegion : function(cityIds, regions, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'RegionSelect',
            'selectRegion',
            [{
               "cityIds": cityIds,
               "regions": regions
             }]
            );
       }
    }
  }
);
